import Stack from 'react-bootstrap/Stack';

// Home.js
import React from "react";

const Home = () => {
  return (
    <Stack gap={3}>
      <div className="p-2">First item</div>
      <div className="p-2">Second item</div>
      <div className="p-2">Third item</div>
    </Stack>
  );
};

export default Home;
